import ReactDOM from "react-dom/client";
import "./index.css";
import CanvasWidget from "./components/Canvas";
import Header from "./components/Header";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
	<div>
		<Header />
		<CanvasWidget />
	</div>
);
